const InputComponent = ({ inputData, clearInput, addItem }) => {
    return (
        <div>
            <input type="text" value={inputData} onChange={(event) => {
                clearInput(); // Clear input on every change
                addItem(event.target.value); // Add item to order list
            }} />
        </div>
    );
};
export default InputComponent;
